import './sidebar.scss';
import DashboardIcon from '@mui/icons-material/Dashboard';
import GroupIcon from '@mui/icons-material/Group';
import Inventory2Icon from '@mui/icons-material/Inventory2';
import ProductionQuantityLimitsIcon from '@mui/icons-material/ProductionQuantityLimits';
import LocalShippingIcon from '@mui/icons-material/LocalShipping';
import QueryStatsIcon from '@mui/icons-material/QueryStats';
import NotificationsIcon from '@mui/icons-material/Notifications';
import HealthAndSafetyIcon from '@mui/icons-material/HealthAndSafety';
import PsychologyIcon from '@mui/icons-material/Psychology';
import SettingsIcon from '@mui/icons-material/Settings';
import PersonIcon from '@mui/icons-material/Person';
import ExitToAppIcon from '@mui/icons-material/ExitToApp';

const Sidebar = () => {

  const handleClick = (menuItem) => {
    console.log(`Clicked on ${menuItem}`);
  };

  return (
    <div className='sidebar'>
        <div className='top'>
          <span className='logo'>Admin Panel</span>
        </div>
        <hr />
        <div className='center'>
          <ul>
            <p className="title">MAIN MENU</p>
            <li onClick={() => handleClick('Dashboard')}>
              <DashboardIcon className='icon' />
              <span>Dashboard</span>
            </li>
            <p className="title">LISTS MENU</p>
            <li onClick={() => handleClick('Users')}>
              <GroupIcon className='icon' />
              <span>Users</span>
            </li>
            <li onClick={() => handleClick('Products')}>
              <Inventory2Icon className='icon' />
              <span>Products</span>
            </li>
            <li onClick={() => handleClick('Orders')}>
              <ProductionQuantityLimitsIcon className='icon' />
              <span>Orders</span>
            </li>
            <li onClick={() => handleClick('Delivery')}>
              <LocalShippingIcon className='icon' />
              <span>Delivery</span>
            </li>

            <p className="title">ACCOUNT</p>

            <li onClick={() => handleClick('Logout')}>
              <ExitToAppIcon className='icon' />
              <span>Logout</span>
            </li>
          </ul>
        </div>
        <div className='bottom'>
          <div className='colorOptions'></div>
          <div className='colorOptions'></div>
        </div>
    </div>
  );
}

export default Sidebar;
